Text:
@mikedongs
You may want to Force Re-Check in your torrent client. Seems to be only on your end. You probably downloaded it as a broken file. Sometimes torrents don't fully allocate and break during download. 

Check the CRC of the file you obtained. It should read 952c1122. If not, Force Re-Check and continue downloading it. The file works perfectly. Verify you have the proper codecs installed if playback issues continue to occur.
